        "00029359"
      ],
      "minLength": 1,
      "maxLength": 8,
      "pattern": "^(.*)$"
    },
    "tripNumber": {
      "$id": "#/properties/tripNumber",
      "type": "string",
      "title": "The Tripnumber Schema",
      "default": "",
